(19, 'terms_and_conditions', '<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\"><p><strong style=\"color: rgb(31, 31, 31);\">Introduction</strong></p><p><br></p><p>Welcome to ZAFIRO. By using this app, you agree to be bound by these terms and conditions.</p><p><br></p><p><strong style=\"color: rgb(31, 31, 31);\">Changes to Terms and Conditions</strong></p><p><br></p><p><span style=\"color: rgb(31, 31, 31);\">We may update these terms and conditions from time to time. The most current version will always be posted on our app. You are responsible for reviewing the terms and conditions regularly. Your continued use of the website or app after any changes to the terms and conditions constitutes your acceptance of those changes.</span></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>', NULL, '2023-09-13 19:39:58'),
