(39, 'privacy_policy', '<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\"><h2><span style=\"background-color: transparent; color: rgb(34, 110, 147);\">Privacy Policy</span></h2><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">Winji App is an Ad Supported app. This SERVICE is provided by Winji Company at no cost and is intended for use as is.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">This page is used to inform visitors regarding my policies with the collection, use, and disclosure of Personal Information if anyone decided to use my Service.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">If you choose to use my Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that I collect is used for providing and improving the Service. I will not use or share your information with anyone except as described in this Privacy Policy.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">The terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, which is accessible at Winji unless otherwise defined in this Privacy Policy.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Information Collection and Use</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">For a better experience, while using our Service, I may require you to provide us with certain personally identifiable information, including but not limited to Winji . The information that we request will be retained on your device and is not collected by me in any way.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">The app does use third party services that may collect information used to identify you.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">Link to privacy policy of third party service providers used by the app&nbsp;</span></p><ul><li><a href=\"https://www.google.com/policies/privacy/\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 101, 128);\">Google Play Services</a></li><li><a href=\"https://support.google.com/admob/answer/6128543?hl=en\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 101, 128);\">AdMob</a></li><li><a href=\"https://firebase.google.com/policies/analytics\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 101, 128);\">Firebase Analytics</a></li><li><a href=\"https://www.facebook.com/about/privacy\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 101, 128);\">Facebook</a></li></ul><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Log Data</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">I want to inform you that whenever you use my Service, in a case of an error in the app I collect data and information (through third party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (“IP”) address, device name, operating system version, the configuration of the app when utilizing my Service, the time and date of your use of the Service, and other statistics.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Cookies</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device\'s internal memory.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">This Service does not use these “cookies” explicitly. However, the app may use third party code and libraries that use “cookies” to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Service Providers</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">I may employ third-party companies and individuals due to the following reasons:&nbsp;</span></p><ul><li><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">To facilitate our Service;</span></li><li><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">To provide the Service on our behalf;</span></li><li><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">To perform Service-related services; or</span></li><li><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">To assist us in analyzing how our Service is used.</span></li></ul><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">I want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Security</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">I value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and I cannot guarantee its absolute security.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Links to Other Sites</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by me. Therefore, I strongly advise you to review the Privacy Policy of these websites. I have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Children’s Privacy</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">These Services do not address anyone under the age of 13. I do not knowingly collect personally identifiable information from children under 13. In the case I discover that a child under 13 has provided me with personal information, I immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact me so that I will be able to do necessary actions.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Changes to This Privacy Policy</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">I may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. I will notify you of any changes by posting the new Privacy Policy on this page. These changes are effective immediately after they are posted on this page.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(33, 33, 33);\">Contact Us</strong></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">If you have any questions or suggestions about my Privacy Policy, do not hesitate to contact me at info@winji.org.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">info@winji.org</span></p><p><span style=\"background-color: transparent; color: rgb(33, 33, 33);\">0201128861395</span></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>', NULL, '2022-09-20 17:46:27'),
